import React from "react";

export const WorkExperience = ()=>{

    const styles = {
        container: {
            padding: '150px',
            fontSize: '19px',
            lineHeight: '1.5',
            textAlign: 'center',
        },
        heading: {
            fontSize: '36px',
            marginBottom: '30px',
        },
    };
    return (
        <div style={styles.container}>
            <h2 style={styles.heading}>Work Experience</h2>




        </div>
    );
}
